import React from "react";
function From(){
    return ( 
        <div>
            <form>
                <Control type='text' label='Email'/> <br/>
                <Control type='password'/>
                <input type="checkbox" />
            </form>
        </div>
    )
}


function Control(props){
    return (
        <input type={props.type} placeholder={props.label} />
    )
}

export default From;
